    /**
     * Returns an object that holds namespace information
     * 
     * @return NameSpaceAPI|null
     */
    public function getNSObj() {
        return $this->nsObj;
    }
    /**
     * Sets the object which is used to display namespace information.
     * 
     * @param NameSpaceAPI $c An object that holds namespace information.
     * 
     */
    public function setNSObj(NameSpaceAPI $c) {
        $this->nsObj = $c;
    }
    /**
     * Returns an object that holds link information of a class or     * a class method.
     * 
     * @param string $c Class name with or without method name or attribute.
     * 
     * @return Anchor|null If a link exist, it is returned as an object of
     * type 'Anchor'. Other than that, null is returned.
     */
    public function getLink($c) {
        if (isset($this->linksArr[$c])) {
            return $this->linksArr[$c];
        }
    }
    /**
     * Returns an array that holds all added methods definitions     * of the class.
     * 
     * @return array An array that holds objects which holds methods
     * Definitions.
     */
    public function getMethods() {
        return $this->methodsArr;
    }
    /**
     * Returns an array that holds all added attributes definitions     * of the class.
     * 
     * @return array An array that holds objects which holds attributes
     * Definitions.
     */
    public function getAttributes() {
        return $this->attrsArr;
    }
    /**
     * Adds a method definition to the set of methods of the class     * 
     * @param FunctionDef $meth An object that holds method definition.
     */
    public function addMethod(FunctionDef $meth) {
        $this->methodsArr[] = $meth;
    }
    /**
     * Adds attributte definition to the set of attributes of the class     * 
     * @param AttributeDef $meth An object that holds attribute definition.
     */
    public function addAttribute(AttributeDef $attr) {
        $this->attrsArr[] = $attr;
    }
    /**
     * Returns an array that holds all classes which are included in
     * the generated docs.
     * 
     * @return array The indices of the array will be the namespaces and in
     * each index is a sub array that holds the names of the classes at which they
     * belongs to the namespace.
     */
    public function getClasses() {
        return $this->classesArr;
    }
